def lenLongestFibSubseq(arr):
    index = {x: i for (i, x) in enumerate(arr)}
    dp = [[2] / len(arr) for _ in arr]
    for (j, x) in enumerate(arr):
        for i in range(j):
            if x - arr[i] < arr[i] and x - arr[i] in index:
                dp[i][j] = dp[index[x - arr[i]]][i] + 1
